import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, Button } from "react-native";

export default function App() {
  const Separator = () => (
    <View style={styles.separator} />
  );  

  return (
    <View style={styles.main}>
      <View style={styles.event}>
        <View style={styles.date}>
          <Text>11TH NOV</Text>
        </View>
        <View style={styles.description}>
          <Text>
            A culinary event with foods from all over the world. This is a
            weekly club you can join for a small fee. Learn to cook something
            delicious and beautiful
          </Text>
        </View>
        <View style={styles.button}>
          <Button title="+ Event Details" />
        </View>
        <View style={styles.address}>
          <Text>16:00 - 19:00</Text>
          <Text>144 W Elm St.Chicago, II, 60610, USA</Text>
        </View>
      </View>
      <Separator />

    </View>
  );
}

const styles = StyleSheet.create({
  main: {
    fontFamily: "sans-serif",
    color: "white",
    marginHorizontal: 16,
    paddingHorizontal: 2,
    backgroundColor: "#050505e0",
  },
  event: {
    width: "90%",
    justifyContent: "center",
    alignItems: "flex-start",
  },
  date: {
    backgroundColor: "blue",
    padding: '1em'
  },
  description: {
    backgroundColor: "orange",
    width: 'fit-content',
    padding: '1em'
  },
  button: {
    color: 'none',
    backgroundColor: 'teal',
    flexDirection: 'row',
    justifyContent: 'space-between',

  },
  address: {
    backgroundColor: "yellow",
    width: 'fit-content',
    padding: '1em'
  },
  separator: {
    marginVertical: 8,
    borderBottomColor: '#fff',
    borderBottomWidth: StyleSheet.hairlineWidth,
  },

});
